import React from 'react';
import logo from '../assests/basilurlogo.png';

const AddFreightCoordinator = () => {
  return (
    <div className="min-h-screen bg-lightOliveGreen">
    {/* Header stays at the top */}
    <header className="flex justify-between items-center w-full p-4 bg-darkGreen shadow-md">
      <img src={logo} alt="Logo" className="h-12" />
      <h1 className="text-4xl font-bold text-lightBeige text-center flex-1">Freight Allocation</h1>
      {/* Empty div to balance the layout */}
      <div className="w-12" />
    </header>
    <div className="flex flex-col items-center justify-center min-h-screen bg-lightOliveGreen p-6">
      <h1 className="text-2xl font-bold text-darkGreen mb-6">Add Freight Coordinator</h1>
      <form className="space-y-4">
        {/* Add input fields for coordinator details */}
        <input type="text" placeholder="Name" className="p-3 border border-gray-300 rounded-md" />
        <input type="email" placeholder="Email" className="p-3 border border-gray-300 rounded-md" />
        <button type="submit" className="bg-mediumGreen text-white py-3 px-6 rounded-md text-lg">
          Add Freight Coordinator
        </button>
      </form>
    </div>
    </div>
  );
};

export default AddFreightCoordinator;
